import React, { useState } from 'react'
import 'bootstrap-icons/font/bootstrap-icons.css';

function Calc() {
    const [value, setValue] = useState('');
    const handleButtonClick = (buttonValue) => {
        switch (buttonValue) {
            case 'AC':
                setValue('');
                break;
            case 'DE':
                setValue(value.slice(0, -1));
                break;
            case '.':
            case '/':
            case '*':
            case '+':
            case '-':
                setValue(value + buttonValue);
                break;
            case '=':
                try {
                    setValue(calculate
                        (value).toString());
                } catch (error) {
                    setValue('Error');
                }
                break;
            default:
                setValue(value + buttonValue);
                break;
        }
    };
    const calculate = (expression) => {
        return new Function('return ' + expression)();
    };
    const renderButtons = (buttons) => {
        return buttons.map((button) => (
            <input
                key={button}
                type="button"
                value={button}
                onClick={() => handleButtonClick(button)}
            />
        ));
    };

    return (
        <div>
            <div className="container">
                <div className='cal'>Calculator</div>
                <div className="calculator">
                    <form action="">
                        <div className='display'>
                            <input className='result' type="text" value={value} readOnly />
                        </div>

                        <div>
                            <input type="button" value="AC" onClick={e => setValue('')} />
                            <input type="button" value="DE" onClick={e => setValue(value.slice(0, -1))} />
                            <input type="button" value="." onClick={e => setValue(value + e.target.value)} />
                            <input type="button" value="/" onClick={e => setValue(value + e.target.value)} />

                        </div>
                        <div>
                        <input type="button" value="7" onClick={e => setValue('')} />
                            <input type="button" value="8" onClick={e => setValue(value.slice(0, -1))} />
                            <input type="button" value="9" onClick={e => setValue(value + e.target.value)} />
                            <input type="button" value="*" onClick={e => setValue(value + e.target.value)} />

                        </div>
                        <div>
                        <input type="button" value="4" onClick={e => setValue('')} />
                            <input type="button" value="5" onClick={e => setValue(value.slice(0, -1))} />
                            <input type="button" value="6" onClick={e => setValue(value + e.target.value)} />
                            <input type="button" value="+" onClick={e => setValue(value + e.target.value)} />

                        </div>
                        <div>
                        <input type="button" value="1" onClick={e => setValue('')} />
                            <input type="button" value="2" onClick={e => setValue(value.slice(0, -1))} />
                            <input type="button" value="3" onClick={e => setValue(value + e.target.value)} />
                            <input type="button" value="-" onClick={e => setValue(value + e.target.value)} />

                        </div>
                        <div>
                        <input type="button" value="00" onClick={e => setValue('')} />
                            <input type="button" value="0" onClick={e => setValue(value.slice(0, -1))} />
                            <input type="button" value="=" onClick={e => setValue(value + e.target.value)} />
                            <input type="button" value="/" onClick={e => setValue(value + e.target.value)} />
                        </div>
                    </form>
                </div>
            </div>
        </div>
    );
}

export default Calc;
